<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Invoice</title>
    <!-- Bootstrap CSS CDN -->
    <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0/dist/css/bootstrap.min.css" rel="stylesheet">
    <style>
        body {
    font-family: 'Arial', sans-serif;
    background-color: #f8f9fa;
    padding: 20px;
}

.invoice {
    max-width: 210mm; /* Set the maximum width to A4 width */
    margin: 0 auto;
    border: 1px solid #dce1e7;
    border-radius: 10px;
    background-color: #fff;
    box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
}

.header img {
    width: 100%;
    height: auto;
    border-top-left-radius: 10px;
    border-top-right-radius: 10px;
}

.customer-details,
.order-info,
.item-list,
.amount-section,
.payment-info,
.signature,
.footer img {
    width: 90%;
    max-width: 100%;
    margin: 20px auto;
}

.customer-details p,
.order-info p {
    margin-bottom: 10px;
}

.item-list th,
.item-list td,
.amount-section td {
    border: 1px solid #dce1e7;
    padding: 12px; /* Reduced padding for a smaller size */
    text-align: left;
}

.total {
    margin-top: 20px;
    text-align: right;
}

.total table {
    width: 100%;
}

.payment-info img {
    border-radius: 5px;
    max-width: 100%;
}

.signature p {
    margin-top: 20px;
    text-align: center;
    font-size: 1.2em;
}

.footer {
    text-align: center;
}

    </style>
</head>
<body>

    <div class="invoice">
        <div class="header">
            <img src="data:image/png;base64," alt="Header Image">
        </div>

        <div class="customer-details">
            <h2 class="text-center mb-4">Customer Details</h2>
            <p><strong>Name:</strong> {{ $name }}</p>
            <p><strong>Address:</strong> {{ $address }}</p>
            <p><strong>Phone:</strong> {{ $phone }}</p>
            <p><strong>Email:</strong> {{ $email }}</p>
            <!-- Add other customer details as needed -->
        </div>

        <div class="order-info">
            <h2 class="text-center mb-4">Customer Copy</h2>
            

            
            <!-- Add other order information as needed -->
        </div>

        <table class="item-list table">
            <thead>
                <tr>
                    <th>#NO</th>
                    <th>Description</th>
                    <th>UNIT PRICE</th>
                    <th>QTY</th>
                    <th>TOTAL(LKR)</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <td>1</td>
                    <td>Registration Fee</td>
                    <td>$50.00</td>
                    <td>1</td>
                    <td>$50.00</td>
                </tr>
                <!-- Add more items as needed -->
            </tbody>
        </table>

        <div class="total amount-section">
            <h2 class="text-center mb-4">Total</h2>
            <table class="table">
                <tr>
                    <td>SUB TOTAL:</td>
                    <td>LKR</td>
                    <td>50.00</td>
                </tr>
                <tr>
                    <td>DISCOUNTS:</td>
                    <td>LKR</td>
                    <td>0.00</td>
                </tr>
                <tr>
                    <td>TOTAL:</td>
                    <td>LKR</td>
                    <td>50.00</td>
                </tr>
            </table>
        </div>

        <div class="payment-info text-center">
            <img src=" data:image/png;base64," alt="Payment Info Image" class="img-fluid">
        </div>

        <div class="signature">
            <p><strong>Authorized Signature:</strong></p>
            <!-- Add a signature field or image as needed -->
        </div>

        <div class="footer">
            <img src=" data:image/png;base64," alt="Footer Image">
        </div>
    </div>

    <!-- Bootstrap JS and Popper.js CDN -->
    <script src="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0/dist/js/bootstrap.bundle.min.js"></script>
</body>
</html>
